import React from 'react'
import Logo from '../images/themoviedb-logo.png'

const TMDBImage = () => {
    return (
        <div style={{position: 'absolute', right:'20%', width:'30px', height:'20px'}}>
            <h3>Powered By</h3>
            <img src={Logo} />
        </div>
    )
}

export default TMDBImage
